import {SelectCity} from "./elements";

export function SearchBar() {
    return (
        <form className="flex items-center justify-center p-4 bg-gray-100">
            <input type="text" placeholder="Search..." className="w-full  max-w-48 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500" />
            <SelectCity />
        </form>
    );
}
